A certificate is not practical for cases such as: peer-to-peer, trust-on-first-use, deliberately insecure applications, or when the servers are not identified by the domain name. Custom certificate validation logic can be implemented when the dangerous_configuration function of rustls is enabled. Once done, the certificate verifier can manually override in the quinn::ClientConfig. Start with adding a rustls dependency with the dangerous_configuration feature flag to your toml file. quinn = "*"
rustls = { version = "*", features = ["dangerous_configuration", "quic"] } Then, you can skip the certificate validation on the client by implementing rustls::ServerCertVerifier and let it always return 'correct'. // Implementation of `ServerCertVerifier` that verifies everything as trustworthy.
struct SkipCertificationVerification; impl rustls::ServerCertVerifier for SkipCertificationVerification { fn verify_server_cert( &self, _roots: &rustls::RootCertStore, _presented_certs: &[rustls::Certificate], _dns_name: webpki::DNSNameRef, _ocsp_response: &[u8], ) -> Result<rustls::ServerCertVerified, rustls::TLSError> { Ok(ServerCertVerified::assertion()) }
} After that, we can configure our ClientConfig to use this new CertificateVerifier. pub fn insecure() -> ClientConfig { let mut cfg = quinn::ClientConfigBuilder::default().build(); // Get a mutable reference to the 'crypto' config in the 'client config'.. let tls_cfg: &mut rustls::ClientConfig = std::sync::Arc::get_mut(&mut cfg.crypto).unwrap(); // Change the certification verifier. // This is only available when compiled with 'dangerous_configuration' feature. tls_cfg .dangerous() .set_certificate_verifier(Arc::new(SkipCertificationVerification)); cfg
} Finally, if you throw this ClientConfig into the Endpoint::default_client_config() your endpoint should verify all connections as trustworthy.

