In this section we look at certifying an endpoint with a real certificate. This can be done with a real certificate, but also with a self-identified certificate. Let's define two useful functions that can dissect byte certificates and return quinn types. pub fn parse_der(cert: Vec<u8>, private_key: Vec<u8>) -> anyhow::Result<(quinn::Certificate, quinn::PrivateKey)> { let cert = quinn::Certificate::from_der(&cert)?; let key = quinn::PrivateKey::from_der(&private_key)?; Ok((cert, key))
} pub fn parse_pem(cert: Vec<u8>, private_key: Vec<u8>) -> anyhow::Result<(quinn::Certificate, quinn::PrivateKey)> { // Parse to certificate chain whereafter taking the first certificate in this chain. let cert = quinn::CertificateChain::from_pem(&cert)?.iter().next().unwrap().clone(); let key = quinn::PrivateKey::from_pem(&private_key)?; Ok((quinn::Certificate::from(cert), key))
} There are two common certificate formats namely: .pem and .der. The .der certificates are byte-coded, while .pem is text-coded. You can translate one to the other by using tooling such as openssl or even within code self. The code translation is shown above.

